textOriginal:
Seria como se nao fosse tragico!Esses mesmos bolsonaristas tem aquele famoso lema:Deus,Patria,Familia e Liberdade!
Deus so se for o deles,quem acredita em outra religiao que nao for a deles geralmente e deixado de lado,isso quando nao e xingado ou colocado em evidencia;
Patria so se for so pra eles,tanto faz se muitas pessoas estao procurando comida no lixo,se muita gente esta na fila do osso,etc
Familia so se for a deles,e muitos gostam tanto da Familia que muitas vezes tem 2 Familias;
Liberdade so se for pra eles fazerem cagadas;

As únicas coisas que esse governo fez foi : 

Propagar o ódio ;
Corromper as instituições de segurança ;
Criar o crime de Fakenews ;
E o genocídio. 

Isso que ficou .

Fora Bolsonaro , chora gado !
